from collections import defaultdict

def minimum_distinct_ids(arr: list, m: int) -> int:
    mp = defaultdict(int)
    count = 1
    for i in arr:
        mp[i] += 1
    frequencies = list(mp.values())
    frequencies.sort()
    for freq in frequencies:
        if freq <= m:
            m -= freq
            count += 1
        else:
            break
    return len(frequencies) - count

